import React from 'react';

// import recharts
import {
    LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
} from 'recharts';

// import material ui core 
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';

import styles from '../../assets/styles/components/dashgraphStyle.js';

const useStyles = makeStyles(styles);

export default function DashGraph(props) {

    const classes = useStyles();

    const titleCase = (str) => {
        var splitStr = str.toLowerCase().split(' ');
        for (var i = 0; i < splitStr.length; i++) {
            splitStr[i] = splitStr[i].charAt(0).toUpperCase() + splitStr[i].substring(1);
        }
        return splitStr.join(' ');
    }

    return (
        <Paper className={classes.paper}>
            <LineChart width={600} height={400} data={props.gymData.data}
                margin={{ top: 5, right: 50, left: 20, bottom: 20 }}>
                <XAxis dataKey="date" />
                <YAxis dataKey="weight" />
                <CartesianGrid strokeDasharray="3 3" />
                <Tooltip />
                <Legend verticalAlign="top" height={36} wrapperStyle={{ top: 10, left: 25 }} />
                <Line type="monotone" dataKey={titleCase(props.gymData.workout.name)} stroke="#8884d8" />
            </LineChart>
        </Paper>
    );
}
